import { overVehicles } from "../../constants"
import Button from "../Button"
const Ow_Cars = () => {
    return (
        <>
            {overVehicles.map((car) => {
                return (
                    <section className="h-screen w-full flex-centralizer bg-fullcenter" style={{ backgroundImage: " url(" + car.cover + ")" }}>
                        <div className="grid gap-y-12" >
                            <h2>{car.model}</h2>
                            <h3>{car.subtitle}</h3>
                            <div className="flex">
                                <Button to={car.orderLink} label="Learn About" outline />
                                <Button to={car.learnLink} label="Order Now" dark />
                            </div>
                        </div>
                        <div className="text-center h-3/5 flex flex-col justify-between">
                            <div>
                                <h2 className='font-bold xl:text-4xl text-2xl'>Power is Yours</h2>
                                <p className='my-3'>Produce, Provide and Use Energy Completelly in your very own Home Built</p>
                            </div>
                            <div className="md:flex gap-5 md:mx-auto padding">
                                <Button to='/' label="Explore Products" light />
                                <Button to='/' label="Learn About" customClass="md:mt-0 mt-2" />
                            </div>
                        </div>
                    </section>
                )
            })}
        </>
    );
};

export default Ow_Cars;
